import React, {useEffect, useState} from 'react';
import {useNavigation} from '@react-navigation/native';
import {
  FlatList,
  Image,
  Platform,
  SafeAreaView,
  StyleSheet,
  Text,
  TextInput,
  TouchableOpacity,
  View,
} from 'react-native';
import {api} from '../../api';
import Geolocation from 'react-native-geolocation-service';
import {PermissionsAndroid} from 'react-native';
import {dat} from '../SigInScreen/data';
import Svg, {Line, LinearGradient, Path, Stop} from 'react-native-svg';
import gg from '../../assets/images/background/photo2.png';
